CREATE TABLE IF NOT EXISTS `updated_car_prices` (
    `year` INT,
    `make` VARCHAR(13) CHARACTER SET utf8,
    `C` VARCHAR(23) CHARACTER SET utf8,
    `trim` VARCHAR(43) CHARACTER SET utf8,
    `body` VARCHAR(18) CHARACTER SET utf8,
    `transmission` VARCHAR(9) CHARACTER SET utf8,
    `vin` VARCHAR(17) CHARACTER SET utf8,
    `state` VARCHAR(2) CHARACTER SET utf8,
    `condition` INT,
    `odometer` INT,
    `color` VARCHAR(9) CHARACTER SET utf8,
    `interior` VARCHAR(9) CHARACTER SET utf8,
    `seller` VARCHAR(50) CHARACTER SET utf8,
    `mmr` INT,
    `sellingprice` INT,
    `saledate_time` VARCHAR(39) CHARACTER SET utf8,
    `saledate` DATETIME
);
